import * as React from 'react';
import './index.scss';

export default class extends React.Component<any> {
    render() {    
        return (
        <div className="title">
            Hello Next.js!!
            <div id="ContentAccumulate">
                COLOR
            </div>
        </div>
        )
    }
}
